import React, { useState } from 'react';
import { Link } from 'react-router-dom';





type Props = {};

type Task = {
  label: string;
};

const Navbar: React.FC<Props> = () => {
  const [tasks, setTasks] = useState<Task[]>([]);

  return (
    <nav>
      <div>
        <a>Logo</a>
        <p>Weather by VicBox</p>
      </div>
      <ul>
        <li>
          <Link to="/">GitHub</Link>
        </li>
        <li>
          <Link to="/about">About</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
